import React from "react";
import "./Certifications.css";
import { FaLink } from "react-icons/fa";

const SkillsPage = () => {
  const skills = [
    {
        category: ["Programming for Everybody (Getting Started with Python):"], 
        items: ["University of Michigan by Coursera (03/2020)"],
        link: "https://www.coursera.org/account/accomplishments/certificate/TAUGQGE39MTC",
        icon: <FaLink />
    },
    {
        category: ["Database and Time Series Database:"], 
        items: ["SQL, Victoria Metrics, MongoDB"]
    },
    {
        category: ["DevOps and CI/CD Tools:"], 
        items: ["Kubernetes, Docker, Grafana, Gitlab, Linode, Jenkins, Git, Loki, AWS, Prometheus"]
    },
    {
        category: ["Technologies:"], 
        items: ["Flask, mTLS, REST APIs, React, SpringBoot"]
    }
];

  return (
    <div className="certificates-page">
      <h1>CERTIFICATIONS</h1>
      <ul className="certificates-list">
      {skills.map((category, items) => (
        <li className="category-elements"><strong>{category.category}</strong> {category.items} 
        <a
        href={category.link}
        target="_blank"
        rel="noopener noreferrer"
        style={{ margin: "0 10px", fontSize: "18px", color: "#0e76a8" }}
        onMouseEnter={(e) => (e.currentTarget.style.color = "#000000")}
      >{category.icon}</a></li>
        ))}
      </ul>
    </div>
  );
};

export default SkillsPage;
